import React, { useState } from "react";
import {
  TableContainer,
  Table,
  TableHead,
  TableBody,
  TableRow,
  TableCell,
} from "@material-ui/core";
import { makeStyles } from "@material-ui/core/styles";
import { Navigate, Link } from "react-router-dom";

const useStyles = makeStyles((theme) => ({
  tablaMaterial: {
    minWidth: 800,
  },
}));

function Prueba() {
  const classes = useStyles();
  /*const baseUrl = "http://localhost:4000/createUser";
  const [data, setData] = useState([]);

  const peticionesGet = async () => {
    await axios
      .get(baseUrl)
      .then((response) => {
        setData(response.data);
      })
      .catch((error) => {
        console.log(error);
      });
  };
*/

  var data = [
    { id: 1, name: "Gob", value: "2" },
    { id: 2, name: "Buster", value: "5" },
    { id: 3, name: "George Michael", value: "4" },
    { id: 3, name: "George Michael", value: "4" },
    { id: 3, name: "George Michael", value: "4" },
    { id: 3, name: "George Michael", value: "4" },
    { id: 3, name: "George Michael", value: "4" },
    { id: 3, name: "George Michael", value: "4" },
  ];
  return (
    <div class="Table">
      <h3 class="LabelTitleComponent">Lista deProyectos </h3>
      <TableContainer>
        <Table className={classes.tablaMaterial}>
          <TableHead>
            <TableRow>
              <TableCell align="center">ID</TableCell>
              <TableCell align="center">NAME</TableCell>
              <TableCell align="center">VALOR</TableCell>
              <TableCell align="center">Acciones</TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {data.map((celda) => (
              <TableRow>
                <TableCell>{celda.id}</TableCell>
                <TableCell>{celda.name}</TableCell>
                <TableCell>{celda.value}</TableCell>
                <TableCell align="center">
                  <button className="buttonDelete">Eliminar</button>
                </TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
}
export default Prueba;
